        Berita::create([
            "judul" => "Pemerintah Kalurahan Sentolo",
            "penulis" => "Admin",
            "tanggal" => "2019-03-06",
            "kategoriberita_id" => "4",
            "artikel" => '<p class="MsoNormal" style="margin: 0cm; font-size: 12pt; font-family: &quot;Times New Roman&quot;, serif; text-align: justify;"><span style="font-family: Poppins;">Sistem Organisasi dan Tata Kerja<o:p></o:p></span></p><p class="MsoNormal" style="margin: 0cm; font-size: 12pt; font-family: &quot;Times New Roman&quot;, serif; text-align: justify;"><span style="font-family: Poppins;">&nbsp;</span></p><p class="MsoNormal" style="margin: 0cm; font-size: 12pt; font-family: &quot;Times New Roman&quot;, serif; text-align: justify;"><span style="font-family: Poppins;">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Mulai Tahun 2020 nomenklatur Desa berubah menjadi Kalurahan sebagai akibat pelaksanaan Undang-Undang Nomor 13 Tahun 2012 tentang Keistimewaan Daerah Istimewa Yogyakarta. Sesuai dengan Peraturan Desa Sentolo Nomor 5 Tahun 2019 tentang Susunan Organisasi dan Tata Kerja Pemerintah Kalurahan Sentolo terdapat perubahan nomenklatur pada Sistem Organisasi dan Tata Kerja Pemerintah Kalurahan. Dalam melaksanakan tugas Penyelenggaraan Pemerintah Kalurahan, Lurah dibantu oleh Kesekretariatan, Pelaksana Teknis dan Pelaksana Kewilayahan. Kesekretariatan dikoordinir oleh Carik dengan dibantu Panata Laksana Sarta Pangripta dan Danarta. Pelaksana Teknis terdiri dari Jagabaya, Kamituwa dan Ulu-ulu. Pelaksana Kewilayahan dilakukan oleh Dukuh yang terdiri dari 12 Orang Dukuh (Malangan, Dlaban, Pongangan, Sentolo Lor, Sentolo Kidul, Jangkang Lor, Jangkang Kidul, Gedangan, Jelok, Kalibondol, Siwalan dan Gunungrawas) yang langsung membawahi masyarakat dalam pelaksanaan Pemerintahan, Pembangunan dan Kemasyarakatan. Untuk memperlancar kegiatan penyelenggaraan pemerintahan dibantu oleh 5 Staf Kalurahan (1 Staf Pelungguh dan 4 Staf Non Pelungguh). Dalam menggerakkan roda kemasyarakatan, Kalurahan Sentolo memiliki lembaga dan badan sebagai mitra kerja pemerintah Kalurahan. Dalam pemerintahan mempunyai mitra Badan Permusyawaratan Kalurahan (BPK) dengan jumlah 11 orang. BPK Kalurahan Sentolo mempunyai peranan penting dalam musyawarah untuk mengambil kesepakatan bersama pemerintah Kalurahan terhadap regulasi kebijakan tahunan. BPK Kalurahan Sentolo juga berfungsi sebagai lembaga yang selalu memberikan masukan dan pengawasan intern. Kalurahan Sentolo menganut sistem kelembagaan pemerintahan Kalurahan dengan pola minimal, sebagaimana terlihat pada bagan struktur organisasi sebagai berikut :</span></p><p class="MsoNormal" style="margin: 0cm; font-size: 12pt; font-family: &quot;Times New Roman&quot;, serif; text-align: justify;"><span style="font-family: Poppins;"><br></span><img src="data:image/png;base64," data-filename="Jepretan Layar 2023-10-18 pukul 19.27.44.png" style="width: 100%;"><span style="font-family: Poppins;"><o:p><br></o:p></span></p><p class="MsoNormal" style="margin: 0cm; font-size: 12pt; font-family: &quot;Times New Roman&quot;, serif; text-align: justify;"><span style="font-family: Poppins;"><o:p><br></o:p></span></p><p class="MsoNormal" style="margin: 0cm; font-size: 12pt; font-family: &quot;Times New Roman&quot;, serif; text-align: justify;"><span style="font-family: Poppins;"><o:p>Berikut adalah data aparatur Pemerintahan Kalurahan Sentolo :</o:p></span></p><p class="MsoNormal" style="margin: 0cm; font-size: 12pt; font-family: &quot;Times New Roman&quot;, serif; text-align: justify;"><span style="font-family: Poppins;"><o:p><br></o:p></span></p><p class="MsoNormal" style="margin: 0cm; font-size: 12pt; font-family: &quot;Times New Roman&quot;, serif; text-align: justify;"><span style="font-family: Poppins;"><o:p><br></o:p></span></p><table class="table table-bordered" style="text-align: center;"><tbody><tr><td style="text-align: center;"><b>No</b></td><td style="text-align: center;"><b>Jabatan</b></td><td style="text-align: center;"><b>Nama</b></td><td style="text-align: center;"><b>Pendidikan</b></td><td style="text-align: center;"><b>SK Pengangkatan</b></td></tr><tr><td style="text-align: center;">1</td><td style="text-align: