d><td style="text-align: center;">SMA</td><td style="text-align: center;"><p>55 TAHUN 2019;</p><p>12/12/2019</p></td></tr><tr><td style="text-align: center;">16</td><td style="text-align: center;">DUKUH JANGKANG LOR</td><td style="text-align: center;">WIDADA</td><td style="text-align: center;">SPG/SMA</td><td style="text-align: center;"><p>06/KPTAS/PEM/1993;</p><p>05/05/1993</p></td></tr><tr><td style="text-align: center;">17</td><td style="text-align: center;">DUKUH JANGKANG KIDUL</td><td style="text-align: center;">SUMIJA</td><td style="text-align: center;">SMK</td><td style="text-align: center;"><p>9 TAHUN 2002;</p><p>23/09/2002</p></td></tr><tr><td style="text-align: center;">18</td><td style="text-align: center;">DUKUH GEDANGAN</td><td style="text-align: center;">TUJIMAN</td><td style="text-align: center;">SMA</td><td style="text-align: center;"><p>17 TAHUN 2010;</p><p>30/04/2010</p></td></tr><tr><td style="text-align: center;">19</td><td style="text-align: center;">DUKUH JELOK</td><td style="text-align: center;"><br></td><td style="text-align: center;"><br></td><td style="text-align: center;"><br></td></tr><tr><td style="text-align: center;">20</td><td style="text-align: center;">DUKUH GUNUNG RAWAS</td><td style="text-align: center;">SUKARNI</td><td style="text-align: center;">SMA</td><td style="text-align: center;"><p>83/KPTS/Pem/1991;</p><p>11/02/1991</p></td></tr></tbody></table><p class="MsoNormal" style="text-align: center; margin: 0cm; font-size: 12pt; font-family: &quot;Times New Roman&quot;, serif;"><br></p><p class="MsoNormal" style="margin: 0cm; font-size: 12pt; font-family: &quot;Times New Roman&quot;, serif; text-align: justify;"><span style="font-family: Poppins;">&nbsp; &nbsp; &nbsp; Selain itu, dalam bidang swadaya dan partisipasi masyarakat serta gotong royong Kalurahan Sentolo mempunyai Lembaga Kemasyarakatan Kalurahan, yaitu LPMKal, PKK, Karang Taruna, RT/RW, PAUD/Posyandu, FKPM, Gapoktan, IPSM, P3A, dan Pokdarwis. Dalam struktur sosial kemasyarakatan Kalurahan Sentolo terdiri dari 29 RW dan 60 RT. Dalam administrasi pemerintahan Kalurahan Sentolo terdiri atas 12 pedukuhan. Selain kelembagaan kemasyarakatan kalurahan di atas, terdapat juga lembaga yang menjadi tulang punggung ekonomi Kalurahan Sentolo, yaitu BUM Desa Binangun Mandiri Sejahtera Sentolo. Kemudian terdapat juga lembaga swadaya yang menjadi mitra Pemerintah Kalurahan dalam mengentaskan kemiskinan, yaitu Badan Keswadayaan Masyarakat (BKM).<o:p></o:p></span></p>',
