            "penulis" => "Admin",
            "tanggal" => "2019-03-06",
            "kategoriberita_id" => "4",
            "artikel" => '<p class="MsoNormal" style="margin: 0cm; font-size: 12pt; font-family: Calibri, sans-serif; text-align: justify;"><span style="font-family: Poppins;">Visi</span></p><p class="MsoNormal" style="margin: 0cm; font-size: 12pt; font-family: Calibri, sans-serif; text-align: justify;"><span style="font-family: Poppins;"><br></span></p><p class="MsoNormal" style="margin: 0cm; font-size: 12pt; font-family: Calibri, sans-serif; text-align: justify;"><span style="font-family: Poppins;">Berdasarkan kondisi Kalurahan Sentolo saat ini, tantangan yang dihadapi di tahun-tahun mendatang dan memperhatikan modal dasar yang dimiliki oleh Kalurahan Sentolo, maka visi pembangunan Kalurahan Sentolo Tahun 2022 - 2027 adalah : ”MASYARAKAT KALURAHAN SENTOLO YANG BERSINAR AMAN MAKMUR BERAKHLAK MULIA DAN BERBUDAYA” Visi pembangunan Kalurahan Sentolo Tahun 2022 - 2027 mengarah pada pencapaian tujuan pembangunan Kalurahan yang harus diukur untuk mengetahui tingkat keadilan, kemakmuran, kesejahteraan dan keberbudayaan yang ingin dicapai.</span></p><p class="MsoNormal" style="margin: 0cm; font-size: 12pt; font-family: Calibri, sans-serif; text-align: justify;"><br></p><p class="MsoNormal" style="margin: 0cm; font-size: 12pt; font-family: Calibri, sans-serif; text-align: justify;"><span style="font-family: Poppins;">Keadilan dan kemakmuran adalah hakekat dari kemerdekaan, yaitu hak setiap warga Kalurahan Sentolo untuk memperoleh haknya atas hasil-hasil kegiatan dan pembangunan yang ada sesuai dengan ketentuan-ketentuan yang mengaturnya. Prinsip keadilan dan kemakmuran yang dipergunakan bukanlah pembagian sama rata tetapi mengedepankan atas asas kebersamaan, pemerataan, keseimbangan, gotong-royong, toleransi, dan saling membantu antara yang lemah dan yang kuat. Sebagai pelaksana dan penggerak pembangunan sekaligus obyek pembangunan, rakyat mempunyai hak, baik dalam merencanakan, melaksanakan, maupun menikmati hasil pembangunan.</span></p><p class="MsoNormal" style="margin: 0cm; font-size: 12pt; font-family: Calibri, sans-serif; text-align: justify;"><br></p><p class="MsoNormal" style="margin: 0cm; font-size: 12pt; font-family: Calibri, sans-serif; text-align: justify;"><span style="font-family: Poppins;">Pembangunan haruslah dilaksanakan dari rakyat, oleh rakyat dan untuk rakyat. Oleh karena itu masalah keadilan dan kemakmuran merupakan ciri yang menonjol dalam pembangunan. Pembangunan di Kalurahan Sentolo tidak hanya berorientasi pada keadilan dan kemakmuran semata, melainkan juga menciptakan masyarakat yang sejahtera lahir dan batin. Masyarakat yang sejahtera lahir dan batin merupakan kristalisasi dari masyarakat adil dan makmur baik material maupun spiritual. Kesejahteraan lahir dan batin harus tercermin pada semua aspek kehidupan. Semua rakyat mempunyai kesempatan yang sama dalam meningkatkan taraf kehidupan, memperoleh lapangan pekerjaan, mendapatkan pelayanan sosial, pendidikan dan kesehatan, mengemukakan pendapat, melaksanakan hak-hak politik, menjaga keamanan dan ketertiban, serta mendapatkan perlindungan dan kesamaan di depan hukum, tidak ada diskriminasi dalam bentuk apapun, baik antar individu, gender, maupun wilayah.</span></p><p class="MsoNormal" style="margin: 0cm; font-size: 12pt; font-family: Calibri, sans-serif; text-align: justify;"><br></p><p class="MsoNormal" style="margin: 0cm; font-size: 12pt; font-family: Calibri, sans-serif; text-align: justify;"><span style="font-family: Poppins;">Masyarakat yang sejahtera lahir dan batin adalah masyarakat yang sudah terpenuhi kebutuhan hidupnya serta dapat memberikan makna dan arti penting bagi masyarakat lainnya. Tradisi budaya lokal merupakan bagian penting dalam menanamkan rasa bermasyarakat, dan membantu memberikan rasa identitas kepada masyarkat. Oleh karenanya pengembangan masyarakat akan berupaya mengidentifikasi elemen-elemen penting dari budaya lokal dan melestarikannya. Tradisi budaya lokal ini meliputi sejarah lokal dan peninggalan berharga, kesenian lokal, kerajinan yang berbasis lokal, makanan lokal atau hal lainnya. Pengaruh eksternal dapat memisahkan tradisi-tradisi budaya lokai ini, dan strategi masyarakat yang cermat diperlukan jika tradisi tersebut ingin dilestarikan.</span></p><p class="MsoNormal" style="margin: 0cm; font-size: 12pt; font-family: Calibri, sans-serif; text-align: justify;"><br></p><p class="MsoNormal" style="margin: 0cm; font-size: 12pt; font-family: Calibri, sans-serif; text-align: justify;"><span style="font-family: Poppins;">Masyarakat Kalurahan Sentolo perlu mengidentifikasi apa komponen yang unik dan signifikan dari warisan budaya yang ada dan untuk menentukan komponen mana yang hendak dipertahankan. Oleh karena itu, pembangunan yang ada di Kalurahan Sentolo harus dapat melestarikan nilai-nilai budaya yang telah berkembang dengan baik. Penjelasan visi Lurah tersebut di atas sangat mendukung dan berkaitan erat dengan visi yang dicanangkan oleh Pemerintah Daerah Kabupaten Kulon Progo, yaitu terwujudnya Kulon Progo yang sejahtera, aman, tentram, berkarakter, dan berbudaya berdasarkan iman dan taqwa.<o:p></o:p></span></p><p class="MsoNormal" style="margin: 0cm; font-size: 12pt; font-family: Calibri, sans-serif; text-align: justify;"><span style="font-family: Poppins;">&nbsp;</span></p><p class="MsoNormal" style="margin: 0cm; font-size: 12pt; font-family: Calibri, sans-serif; text-align: justify;"><span style="font-family: Poppins;">MISI</span></p><p class="MsoNormal" style="margin: 0cm; font-size: 12pt; font-family: Calibri, sans-serif; text-align: justify;"><br></p><p class="MsoNormal" style="margin: 0cm; font-size: 12pt; font-family: Calibri, sans-serif; text-align: justify;"><span style="font-family: Poppins;">Untuk mencapai visi tersebut diperlukan langkah-langkah sebagai berikut:<o:p></o:p></span></p><p class="MsoListParagraphCxSpFirst" style="margin: 0cm 0cm 0cm 36pt; font-size: 12pt; font-family: Calibri, sans-serif; text-align: justify; text-indent: -18pt;"><span style="font-family: Poppins;">1.<span style="font-variant-numeric: normal; font-variant-east-asian: normal; font-variant-alternates: normal; font-kerning: auto; font-optical-sizing: auto; font-feature-settings: normal; font-variation-settings: normal; font-variant-position: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><span style="font-family: Poppins;">Menyelenggarakan tata kelola Pemerintahan Kalurahan yang baik (Good Governance);<o:p></o:p></span></p><p class="MsoListParagraphCxSpMiddle" style="margin: 0cm 0cm 0cm 36pt; font-size: 12pt; font-family: Calibri, sans-serif; text-align: justify; text-indent: -18pt;"><span style="font-family: Poppins;">2.<span style="font-variant-numeric: normal; font-variant-east-asian: normal; font-variant-alternates: normal; font-kerning: auto; font-optical-sizing: auto; font-feature-settings: normal; font-variation-settings: normal; font-variant-position: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;">&nbsp;&nbsp;&nbsp;&nbsp; </span></span><span style="font-family: Poppins;">Meningkatkan kualitas kehidupan masyarakat dalam rangka mewujudkan masyarakat yang Bersinar (Bersih dari Narkoba);<o:p></o:p></span></p><p class="MsoListParagraphCxSpMiddle" style="margin: 0cm 0cm 0cm 36pt; font-size: 12pt; font-family: Calibri, sans-serif; text-align: justify; text-indent: -18pt;"><span style="font-family: Poppins;">3.<span style="font-variant-numeric: normal; font-variant-east-asian: normal; font-variant-alternates: normal; font-kerning: auto; font-optical-sizing: auto; font-feature-settings: normal; font-variation-settings: normal; font-variant-position: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;">&nbsp;&nbsp;&nbsp; </span></span><span style="font-family: Poppins;">Meningkatkan stabilitas keamanan dan ketertiban masyarakat dalam rangka mewujudkan masyarakat yang aman, damai dan bersatu;<o:p></o:p></span></p><p class="MsoListParagraphCxSpMiddle" style="margin: 0cm 0cm 0cm 36pt; font-size: 12pt; font-family: Calibri, sans-serif; text-align: justify; text-indent: -18pt;"><span style="font-family: Poppins;">4.<span style="font-variant-numeric: normal; font-variant-east-asian: normal; font-variant-alternates: normal; font-kerning: auto; font-optical-sizing: auto; font-feature-settings: normal; font-variation-settings: normal; font-variant-position: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;">&nbsp;&nbsp;&nbsp; </span></span><span style="font-family: Poppins;">Meningkatkan kemandirian masyarakat dengan mendorong dan menumbuhkembangkan usaha ekonomi produktif, industri, kerajinan rumah tangga, UMKM, pertanian, peternakan dan perikanan dalam rangka mewujudkan kesejahteraan dan kemakmuran masyarakat baik materiil maupun spirituil menuju Kalurahan Sentolo yang mandiri;<o:p></o:p></span></p><p class="MsoListParagraphCxSpMiddle" style="margin: 0cm 0cm 0cm 36pt; font-size: 12pt; font-family: Calibri, sans-serif; text-align: justify; text-indent: -18pt;"><span style="font-family: Poppins;">5.<span style="font-variant-numeric: normal; font-variant-east-asian: normal; font-variant-alternates: normal; font-kerning: auto; font-optical-sizing: auto; font-feature-settings: normal; font-variation-settings: normal; font-variant-position: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;">&nbsp;&nbsp;&nbsp; </span></span><span style="font-family: Poppins;">Menguatkan kegiatan pembinaan agama dalam rangka mewujudkan masyarakat yang berakhlak mulia dengan agama sebagai landasan moral dan etika dalam pembangunan untuk mendorong mencapai kemajuan;<o:p></o:p></span></p><p class="MsoListParagraphCxSpLast" style="margin: 0cm 0cm 0cm 36pt; font-size: 12pt; font-family: Calibri, sans-serif; text-align: justify; text-indent: -18pt;"><span style="font-family: Poppins;">6.<span style="font-variant-numeric: normal; font-variant-east-asian: normal; font-variant-alternates: normal; font-kerning: auto; font-optical-sizing: auto; font-feature-settings: normal; font-variation-settings: normal; font-variant-position: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;">&nbsp;&nbsp;&nbsp; </span></span><span style="font-family: Poppins;">Memelihara dan mengembangkan adat istiadat, budaya lokal dan seni tradisi dalam rangka mewujudkan masyarakat yang berbudaya.<o:p></o:p></span></p>',
