            "artikel" => '<p class="MsoNormal" style="margin: 0cm; font-size: 12pt; font-family: Calibri, sans-serif; text-align: justify;"><span style="font-family: Poppins;">&nbsp; &nbsp;Pada Tahun 2020 terjadi perubahan nomenklatur Kalurahan menjadi Desa sehingga BPD berubah nama menjadi BPK. Pada tanggal 1 April 2020 BPK Kalurahan Sentolo resmi terbentuk berdasarkan Keputusan Bupati No 129/A/2020 tanggal 21 Februari 2020 tentang Peresmian Anggota Badan Permusyawaratan Kalurahan se-Kabupaten Kulon Progo masa jabatan 2020- 2026. Berbeda dengan periode sebelumnya, pada periode ini anggota BPK merupakan representasi dari keterwakilan 9 wilayah dan 1 keterwakilan perempuan. Dikarenakan Kalurahan Sentolo terdiri dari 12 Pedukuhan maka untuk membentuk keterwakilan 9 wilayah beberapa Pedukuhan digabung menjadi 1 wilayah antara lain: Kalibondol dengan Gunung Rawas, Gedangan dengan Jelok, Jangkang Lor dengan Jangkang Kidul, dan Sentolo Lor dengan Sentolo Kidul. BPK Kalurahan Sentolo beranggotakan 9 orang dengan komposisi 1 orang Ketua, 1 orang Wakil Ketua, 1 orang Sekretaris, 2 orang Ketua Bidang dan 4 orang Anggota. Berikut adalah Data BPK Kalurahan Sentolo :</span></p><p class="MsoNormal" style="margin: 0cm; font-size: 12pt; font-family: Calibri, sans-serif; text-align: justify;"><span style="font-family: Poppins;"><br></span></p><p class="MsoNormal" style="margin: 0cm; font-size: 12pt; font-family: Calibri, sans-serif; text-align: justify;"><br></p><table class="table table-bordered"><tbody><tr><td>No</td><td>NAMA</td><td>ALAMAT</td><td>JABATAN</td></tr><tr><td>1</td><td>Budi Hartono, S.Si, M.Si</td><td>Kalibondol</td><td>Ketua</td></tr><tr><td>2</td><td>Suroso</td><td>Sentolo Lor</td><td>Wakil Ketua</td></tr><tr><td>3</td><td>Arini Dwi Miranti</td><td>Pongangan</td><td>Sekretaris</td></tr><tr><td>4</td><td>Sutijono Widjojo, S.I.P</td><td>Malangan</td><td>Wakil Ketua Bidang 1</td></tr><tr><td>5</td><td>Dalwono</td><td>Siwalan</td><td>Wakil Ketua Bidang 2</td></tr><tr><td>6</td><td>Tri Purwatiningsih</td><td>Dlaban</td><td>Anggota</td></tr><tr><td>7</td><td>Sumardi</td><td>Jangkang Kidul</td><td>Anggota</td></tr><tr><td>8</td><td>Sukirman</td><td>Gedangan</td><td>Anggota</td></tr><tr><td>9</td><td>Sri Suryanti</td><td>Siwalan</td><td>Anggota</td></tr></tbody></table>',
