            "tanggal" => "2019-03-06",
            "kategoriberita_id" => "4",
            "artikel" => '<p class="MsoNormal" style="margin: 0cm; font-size: 12pt; font-family: &quot;Times New Roman&quot;, serif; text-align: justify;"><span style="font-family: Poppins;">Menurut Buku Profil Kalurahan Sentolo dengan judul Gapura Kulon Progo : Sejarah Kalurahan Sentolo Karya Dr. Ahmad Athoillah, M.A., disebutkan bahwa setelah dikeluarkannya empat maklumat dari penguasa Kesultanan Yogyakarta dan Kadipaten Pakualaman pada tahun 1946, maka otonomi desa di pusat Kabupaten Kulon Progo mulai dilakukan. Tahun 1947 menjadi penanda penting bagi hadirnya sejarah administrasi Kalurahan Sentolo yang baru yaitu dengan dibentuknya kepengurusan Dewan Perwakilan Rakyat Kelurahan (DPRK). Selain itu, dalam pelaksanaannya, terjadi kesepakatan antara tokohtokoh masyarakat, seperti Lurah Sentolo Hardjodikromo, Lurah Kalibondol Somadisastro, dan sebagian anggota DPRK untuk menggabungkan dua wilayah mereka menjadi Kalurahan Sentolo yang baru. Istilah ‘Sentolo’ tetap dipilih untuk menjadi nama kelurahan gabungan baru untuk membedakan dengan nama Kalurahan Sentolo dan Kalurahan Kalibondol (pra-tahun 1946). Kelurahan baru tersebut memiliki nomor urut kalurahan baru yaitu ‘Kalurahan Sentolo No 1.<o:p></o:p></span></p><p class="MsoNormal" style="margin: 0cm; font-size: 12pt; font-family: &quot;Times New Roman&quot;, serif; text-align: justify;"><span style="font-family: Poppins;">&nbsp;</span></p><p class="MsoNormal" style="margin: 0cm; font-size: 12pt; font-family: &quot;Times New Roman&quot;, serif; text-align: justify;"><span style="font-family: Poppins;">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Perkembangan selanjutnya adalah peristiwa penting yang terjadi pada tanggal 18 Februari 1947 ketika tiga pejabat pamong Kalurahan Sentolo diangkat secara bersamaan. Pengangkatan tiga pamong desa di atas tentu bertujuan untuk melengkapi unsur-unsur pemerintahan Desa Sentolo yang baru. Pada tanggal 18 Februari 1947 nama lurah Kalurahan Sentolo yang baru Hardjosumarto sudah bertanda tangan di sebuah piagem bersama dengan pimpinan DPRK yaitu Martowidagdo. Piagem tersebut merupakan pengangkatan resmi seorang pembantu atau staf bernama Amadiharjo (Atmodiharjo). Sidang yang dilakukan oleh Dewan Perwakilan Rakyat Kelurahan (DPRK) dengan Pamong Kalurahan Sentolo di atas dilakukan berdasar Maklumat Pemerintah Daerah Istimewa Yogyakarta No. 15 pasal 4 dan No. 15 pasal 5 Surat Petoenjoek dari Djawatan Pradja Daerah tertanggal 26 Oktober 1946 No 20/D.P/1946. Keputusan sidang di atas berhasil mengangkat Atmadihardjo (alias Gijono) sebagai pembantoe Kepala Doekoh dengan tanah lungguh P. No 36a klas II c 2935 m2,39 Kepala Dukuh Gunung Rawas yaitu Kartodinomo (lahir 1907) dengan tanah palungguh yaitu Sawah 26/II/5571 dan Setrotaruna (lahir 1907) yang diangkat menjadi Dukuh Jelok dengan sawah 36/II/5571.<o:p></o:p></span></p><p class="MsoNormal" style="margin: 0cm; font-size: 12pt; font-family: &quot;Times New Roman&quot;, serif; text-align: justify;"><span style="font-family: Poppins;">&nbsp;</span></p><p class="MsoNormal" style="margin: 0cm; font-size: 12pt; font-family: &quot;Times New Roman&quot;, serif; text-align: justify;"><span style="font-family: Poppins;">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Pada tanggal 13 Maret 1947 terdapat sebuah pernyataan tertulis Lurah Sentolo Hardjosumarto terkait perkara tanah milik Tjokrowerdojo dari Djlaban. Dalam pernyataannya, Hardjosumarto menyatakan bahwa dirinya adalah ‘Kepala Pemerintahan Kalurahan Sentolo’. Kutipan dari penyataannya terlihat sebagai berikut, yaitu: “Sentolo 13-3-1947. Kami Hardjo Sumarto Kep. Pem. Kl. Sentolo pada hari Kamis Wage Tg. 13-3-194641 tlah priksa atoerannya orang bernama: Tjokrowodjojo Doekoeh; Djlaban Kl. Sentolo/Sentolo/KoelonProgo/Jogjakarta….” Pernyataan tertulis Hardjosumarto di atas menunjukkan bahwa pada tanggal 13 Maret 1947 adalah ‘kepala pemerintahan’ kelurahan Sentolo. Kemudian tanggal 13 Maret 1947 tersebut ditetapkan menjadi Hari Jadi Kalurahan Sentolo dengan Peraturan Kalurahan Sentolo Nomor 3 Tahun 2021 yang disahkan pada tanggal 19 Februari 2021.<o:p></o:p></span></p><p class="MsoNormal" style="margin: 0cm; font-size: 12pt; font-family: &quot;Times New Roman&quot;, serif; text-align: justify;"><span style="font-family: Poppins;">&nbsp;</span></p><p class="MsoNormal" style="margin: 0cm; font-size: 12pt; font-family: &quot;Times New Roman&quot;, serif; text-align: justify;"><span style="font-family: Poppins;">&nbsp;&nbsp;&nbsp;&nbsp; Dengan memilih tanggal 13 Maret 1947, maka secara konseptual Kalurahan Sentolo sebagai sebuah wilayah administratif telah memiliki beberapa unsur penting. Unsur yang dimaksud adalah: pertama, nama kelurahan yang baru yaitu ‘Sentolo’; kedua, wilayah administratif yang baru meliputi gabungan beberapa pedukuhan yang awalnya merupakan bagian dari wilayah Kalurahan Sentolo dan Kalibondol; ketiga, administrator baru yang terdiri dari anggota DPRK, lurah, pamong-pamong lainnya; dan keempat, telah memiliki sebuah sistem pemerintahan baru. Sejak 13 Maret 1947 Kalurahan Sentolo dipimpin oleh Lurah / Kepala Desa/Plt yang menjabat Lurah / Kepala Desa sebagai berikut:<o:p></o:p></span></p><p class="MsoNormal" style="margin: 0cm; font-size: 12pt; font-family: &quot;Times New Roman&quot;, serif; text-align: justify;"><span style="font-family: Poppins;">&nbsp;</span></p><p class="MsoListParagraphCxSpFirst" style="margin: 0cm 0cm 0cm 36pt; font-size: 12pt; font-family: &quot;Times New Roman&quot;, serif; text-align: justify; text-indent: -18pt;"><span style="font-family: Poppins;">1.<span style="font-variant-numeric: normal; font-variant-east-asian: normal; font-variant-alternates: normal; font-kerning: auto; font-optical-sizing: auto; font-feature-settings: normal; font-variation-settings: normal; font-variant-position: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><span style="font-family: Poppins;">Hardjosumarto, Lurah Sentolo definitif dengan masa jabatan Tahun 1947-1948 dan 1951 – 1990;<o:p></o:p></span></p><p class="MsoListParagraphCxSpMiddle" style="margin: 0cm 0cm 0cm 36pt; font-size: 12pt; font-family: &quot;Times New Roman&quot;, serif; text-align: justify; text-indent: -18pt;"><span style="font-family: Poppins;">2.<span style="font-variant-numeric: normal; font-variant-east-asian: normal; font-variant-alternates: normal; font-kerning: auto; font-optical-sizing: auto; font-feature-settings: normal; font-variation-settings: normal; font-variant-position: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;">&nbsp;&nbsp;&nbsp;&nbsp; </span></span><span style="font-family: Poppins;">Pawiroirono, plt Lurah Sentolo dengan masa jabatan Tahun 1949-1950;<o:p></o:p></span></p><p class="MsoListParagraphCxSpMiddle" style="margin: 0cm 0cm 0cm 36pt; font-size: 12pt; font-family: &quot;Times New Roman&quot;, serif; text-align: justify; text-indent: -18pt;"><span style="font-family: Poppins;">3.<span style="font-variant-numeric: normal; font-variant-east-asian: normal; font-variant-alternates: normal; font-kerning: auto; font-optical-sizing: auto; font-feature-settings: normal; font-variation-settings: normal; font-variant-position: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;">&nbsp;&nbsp;&nbsp; </span></span><span style="font-family: Poppins;">Darmowardojo, Lurah Sentolo definitif dengan masa jabatan Tahun 1951;<o:p></o:p></span></p><p class="MsoListParagraphCxSpMiddle" style="margin: 0cm 0cm 0cm 36pt; font-size: 12pt; font-family: &quot;Times New Roman&quot;, serif; text-align: justify; text-indent: -18pt;"><span style="font-family: Poppins;">4.<span style="font-variant-numeric: normal; font-variant-east-asian: normal; font-variant-alternates: normal; font-kerning: auto; font-optical-sizing: auto; font-feature-settings: normal; font-variation-settings: normal; font-variant-position: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;">&nbsp;&nbsp;&nbsp; </span></span><span style="font-family: Poppins;">Sukotjo, Lurah Sentolo dengan masa jabatan Tahun 1991 – 1999;<o:p></o:p></span></p><p class="MsoListParagraphCxSpMiddle" style="margin: 0cm 0cm 0cm 36pt; font-size: 12pt; font-family: &quot;Times New Roman&quot;, serif; text-align: justify; text-indent: -18pt;"><span style="font-family: Poppins;">5.<span style="font-variant-numeric: normal; font-variant-east-asian: normal; font-variant-alternates: normal; font-kerning: auto; font-optical-sizing: auto; font-feature-settings: normal; font-variation-settings: normal; font-variant-position: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;">&nbsp;&nbsp;&nbsp; </span></span><span style="font-family: Poppins;">Soegiyanto, Lurah Sentolo definitif dengan masa jabatan Tahun 2000 – 2008;<o:p></o:p></span></p><p class="MsoListParagraphCxSpMiddle" style="margin: 0cm 0cm 0cm 36pt; font-size: 12pt; font-family: &quot;Times New Roman&quot;, serif; text-align: justify; text-indent: -18pt;"><span style="font-family: Poppins;">6.<span style="font-variant-numeric: normal; font-variant-east-asian: normal; font-variant-alternates: normal; font-kerning: auto; font-optical-sizing: auto; font-feature-settings: normal; font-variation-settings: normal; font-variant-position: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;">&nbsp;&nbsp;&nbsp; </span></span><span style="font-family: Poppins;">Sukamti Wahyuningsih, plt Lurah Sentolo dengan masa jabatan Tahun 2014-2015;<o:p></o:p></span></p><p class="MsoListParagraphCxSpLast" style="margin: 0cm 0cm 0cm 36pt; font-size: 12pt; font-family: &quot;Times New Roman&quot;, serif; text-align: justify; text-indent: -18pt;"><span style="font-family: Poppins;">7.<span style="font-variant-numeric: normal; font-variant-east-asian: normal; font-variant-alternates: normal; font-kerning: auto; font-optical-sizing: auto; font-feature-settings: normal; font-variation-settings: normal; font-variant-position: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;">&nbsp;&nbsp;&nbsp;&nbsp; </span></span><span style="font-family: Poppins;">Teguh, Lurah Sentolo definitif dengan masa jabatan Tahun 2008 – 2014, 2015 – 2021, dan 2021-sekarang.<o:p></o:p></span></p>',
