            "tanggal" => "2023-01-01",
            "kategoriberita_id" => "4",
            "artikel" => '<p class="MsoNormal" style="margin: 0cm; font-size: 12pt; font-family: &quot;Times New Roman&quot;, serif; text-align: justify;"><b><span style="font-family: Poppins;">KEADAAN SOSIAL<o:p></o:p></span></b></p><p class="MsoNormal" style="margin: 0cm; font-size: 12pt; font-family: &quot;Times New Roman&quot;, serif; text-align: justify;"><b><span style="font-family: Poppins;">&nbsp;</span></b></p><p class="MsoNormal" style="margin: 0cm; font-size: 12pt; font-family: &quot;Times New Roman&quot;, serif; text-align: justify;"><b><span style="font-family: Poppins;">1. Agama<o:p></o:p></span></b></p><p class="MsoNormal" style="margin: 0cm; font-size: 12pt; font-family: &quot;Times New Roman&quot;, serif; text-align: justify;"><span style="font-family: Poppins;">&nbsp;</span></p><p class="MsoNormal" style="margin: 0cm; font-size: 12pt; font-family: &quot;Times New Roman&quot;, serif; text-align: justify;"><span style="font-family: Poppins;">&nbsp;&nbsp;&nbsp;&nbsp; Penduduk Kalurahan Sentolo terdiri dari pemeluk agama yaitu Islam, Kristen dan Katholik. Semua penganut agama hidup berdampingan secara tenteram dan damai. Bangunan Masjid dan Mushola tersebar di semua pedukuhan, sedangkan Gereja Kristen Jawa dan Gereja Katholik Santo Paulus di Pedukuhan Siwalan. Gereja Kristen juga terdapat di Pedukuhan Jangkang Lor serta Wisma Doa berada di Pedukuhan Gedangan. Tokoh agama di Kalurahan Sentolo terdapat 12 orang Rois dan 3 orang Pamong Lingkungan Gereja.<o:p></o:p></span></p><p class="MsoNormal" style="margin: 0cm; font-size: 12pt; font-family: &quot;Times New Roman&quot;, serif; text-align: justify;"><span style="font-family: Poppins;">&nbsp;</span></p><p class="MsoNormal" style="margin: 0cm; font-size: 12pt; font-family: &quot;Times New Roman&quot;, serif; text-align: justify;"><b><span style="font-family: Poppins;">2. Kesehatan Masyarakat<o:p></o:p></span></b></p><p class="MsoNormal" style="margin: 0cm; font-size: 12pt; font-family: &quot;Times New Roman&quot;, serif; text-align: justify;"><span style="font-family: Poppins;">&nbsp;</span></p><p class="MsoNormal" style="margin: 0cm; font-size: 12pt; font-family: &quot;Times New Roman&quot;, serif; text-align: justify;"><span style="font-family: Poppins;">&nbsp;&nbsp;&nbsp; Fasilitas pelayanan kesehatan dari ibu hamil, bayi, balita sampai lanjut usia sudah cukup memadai. Seluruh bayi dan balita di Kalurahan Sentolo sudah terlayani dengan adanya fasilitas 13 Posyandu di 12 Pedukuhan. Kesehatan ibu hamil terlayani dengan baik oleh Puskesmas Sentolo 1 dan didukung dengan adanya kelas ibu hamil, tenaga kesehatan dan fasilitas yang memadai serta pelayanan yang baik. Kegiatan senam lansia dilaksanakan di beberapa Pedukuhan, senam lansia di Balai Kalurahan Sentolo yang dilanjutkan pemeriksaan kesehatan dan pemberian makanan tambahan (PMT Lansia).<o:p></o:p></span></p><p class="MsoNormal" style="margin: 0cm; font-size: 12pt; font-family: &quot;Times New Roman&quot;, serif; text-align: justify;"><span style="font-family: Poppins;">&nbsp;</span></p><p class="MsoNormal" style="margin: 0cm; font-size: 12pt; font-family: &quot;Times New Roman&quot;, serif; text-align: justify;"><span style="font-family: Poppins;">&nbsp; Kondisi rumah tempat tinggal sebagian besar di Kalurahan Sentolo sudah permanen dan memenuhi syarat kesehatan, tetapi di beberapa pedukuhan masih ada rumah yang tidak layak huni yang tersebar di pedukuhan Jangkang Lor, Jangkang Kidul, Gedangan, Kalibondol, Jelok dan Gunung Rawas. Kondisi fasilitas keluarga seperti Mandi-Cuci-Kakus (MCK) di pedukuhan tersebut juga masih kurang sehingga diperlukan program RTLH dan Jambanisasi Keluarga.<o:p></o:p></span></p><p class="MsoNormal" style="margin: 0cm; font-size: 12pt; font-family: &quot;Times New Roman&quot;, serif; text-align: justify;"><span style="font-family: Poppins;">&nbsp;</span></p><p class="MsoNormal" style="margin: 0cm; font-size: 12pt; font-family: &quot;Times New Roman&quot;, serif; text-align: justify;"><span style="font-family: Poppins;">&nbsp; Sebagian masyarakat masih belum mengetahui dan menyadari adanya bahaya kesehatan bagi perokok. Pada Fasilitas Umum, Kantor, tempat pendidikan dan di Balai Pertemuan masih sering dijumpai para perokok. Adanya budaya merokok ini, sehingga diperlukan Kawasan Tanpa Rokok (KTR) untuk melindungi hak asasi setiap manusia untuk memperoleh udara yang bersih dan segar.<o:p></o:p></span></p><p class="MsoNormal" style="margin: 0cm; font-size: 12pt; font-family: &quot;Times New Roman&quot;, serif; text-align: justify;"><span style="font-family: Poppins;">&nbsp;</span></p><p class="MsoNormal" style="margin: 0cm; font-size: 12pt; font-family: &quot;Times New Roman&quot;, serif; text-align: justify;"><span style="font-family: Poppins;"><b>3. Keamanan Dan Ketertiban Masyarakat</b><o:p></o:p></span></p><p class="MsoNormal" style="margin: 0cm; font-size: 12pt; font-family: &quot;Times New Roman&quot;, serif; text-align: justify;"><span style="font-family: Poppins;">&nbsp;</span></p><p class="MsoNormal" style="margin: 0cm; font-size: 12pt; font-family: &quot;Times New Roman&quot;, serif; text-align: justify;"><span style="font-family: Poppins;">&nbsp;&nbsp; Keamanan yang asal katanya aman adalah suatu kondisi yang bebas dari segala macam bentuk gangguan dan hambatan. Sedangkan pengertian Ketertiban adalah suatu keadaan dimana segala kegiatan dapat berfungsi dan berperan sesuai ketentuan yang ada.<o:p></o:p></span></p><p class="MsoNormal" style="margin: 0cm; font-size: 12pt; font-family: &quot;Times New Roman&quot;, serif; text-align: justify;"><span style="font-family: Poppins;">&nbsp;</span></p><p class="MsoNormal" style="margin: 0cm; font-size: 12pt; font-family: &quot;Times New Roman&quot;, serif; text-align: justify;"><span style="font-family: Poppins;">&nbsp;&nbsp; Kalurahan Sentolo terletak pada daerah yang strategis dilintasi jalan Nasional yang menghubungkan persimpangan jalan ke utara menuju daerah Magelang Jawa Tengah, Ke Barat Menuju Daerah Purworejo dan Ke Timur Menuju Yogyakarta. Disamping itu Kalurahan Sentolo merupakan Kalurahan yang memiliki jumlah penduduk yang besar dan termasuk padat penduduk. Dengan demikian secara geografis maupun demografis termasuk kawasan yang rawan keamanan dan terjadinya konflik. Maka dari itu keamanan dan ketertiban masyarakat menjadi perhatian yang utama dalam Pembanguan Kalurahan. Pembinaan masyarakat dalam keamanan dan ketertiban, antara lain pembentukan kelompok masyarakat sadar hukum (Pokmaskum), forum kemitraan polisi masyarakat (FKPM), pembinaan Linmas, menggalakan sistem keamanan lingkungan (siskamling), penyuluhan-penyuluhan langsung kepada masyarakat.<o:p></o:p></span></p><p class="MsoNormal" style="margin: 0cm; font-size: 12pt; font-family: &quot;Times New Roman&quot;, serif; text-align: justify;"><span style="font-family: Poppins;">&nbsp;</span></p><p class="MsoNormal" style="margin: 0cm; font-size: 12pt; font-family: &quot;Times New Roman&quot;, serif; text-align: justify;"><span style="font-family: Poppins;">Pembinaan anggota Linmas: 1) Laki - laki : 56 orang 2) Perempuan : 3 orang;<o:p></o:p></span></p><p class="MsoNormal" style="margin: 0cm; font-size: 12pt; font-family: &quot;Times New Roman&quot;, serif; text-align: justify;"><span style="font-family: Poppins;">Ketentraman dan ketertiban lingkungan: 1) Jumlah Pos Kamling : 48 Buah 2) Jumlah peronda kampung: 50 Kelompok.<o:p></o:p></span></p><p class="MsoNormal" style="margin: 0cm; font-size: 12pt; font-family: &quot;Times New Roman&quot;, serif; text-align: justify;"><span style="font-family: Poppins;">&nbsp;</span></p><p class="MsoNormal" style="margin: 0cm; font-size: 12pt; font-family: &quot;Times New Roman&quot;, serif; text-align: justify;"><b><span style="font-family: Poppins;">4. Kedaulatan Politik Masyarakat<o:p></o:p></span></b></p><p class="MsoNormal" style="margin: 0cm; font-size: 12pt; font-family: &quot;Times New Roman&quot;, serif; text-align: justify;"><span style="font-family: Poppins;">&nbsp;</span></p><p class="MsoNormal" style="margin: 0cm; font-size: 12pt; font-family: &quot;Times New Roman&quot;, serif; text-align: justify;"><span style="font-family: Poppins;">&nbsp;&nbsp; a. Peran serta masyarakat dalam pembangunan<o:p></o:p></span></p><p class="MsoNormal" style="margin: 0cm; font-size: 12pt; font-family: &quot;Times New Roman&quot;, serif; text-align: justify;"><span style="font-family: Poppins;">&nbsp;</span></p><p class="MsoNormal" style="margin: 0cm; font-size: 12pt; font-family: &quot;Times New Roman&quot;, serif; text-align: justify;"><span style="font-family: Poppins;">&nbsp;&nbsp; Peran serta masyarakat dalam bidang politik dalam rangka pembangunan Kalurahan terkait dengan cara penentuan Lurah dan Pamong Kalurahan, pemilihan anggota Badan Permusyawaratan Kalurahan (BPK), Lembaga Kemasyarakatan Kalurahan (LPMKal, PKK, RT, RW, Karang Taruna) maupun peran serta masyarakat Kalurahan dalam musyawarah perncanaan pembangunan Kalurahan. Untuk penentuan Lurah dengan cara pemilihan langsung oleh masyarakat Kalurahan sedangkan Pamong Kalurahan ditetapkan oleh Lurah melalui proses ujian seleksi yang berdasarkan peraturan perundang-undangan yang berlaku. Untuk penentuan anggota BPK dilakukan dengan cara musyawarah dengan melibatkan peran serta perempuan sebagai salah satu calon yang berhak dipilih. Sedangkan pembentukan pengurus Lembaga Kemasyarakatan Kalurahan dilakukan secara demokratis dan diutamakan musyawarah mufakat. Untuk menentukan arah kebijakan pembangunan Kalurahan minimal satu tahun sekali diadakan musyawarah perencanaan pembangunan yang dimulai dari tingkatan paling bawah, yaitu Pedukuhan. Hasil dari musyawarah Pedukuhan ini kemudian dibawa ke forum musyawarah di tingkat Kalurahan.<o:p></o:p></span></p><p class="MsoNormal" style="margin: 0cm; font-size: 12pt; font-family: &quot;Times New Roman&quot;, serif; text-align: justify;"><span style="font-family: Poppins;">&nbsp;</span></p><p class="MsoNormal" style="margin: 0cm; font-size: 12pt; font-family: &quot;Times New Roman&quot;, serif; text-align: justify;"><span style="font-family: Poppins;">&nbsp;&nbsp; b. Adat istiadat<o:p></o:p></span></p><p class="MsoNormal" style="margin: 0cm; font-size: 12pt; font-family: &quot;Times New Roman&quot;, serif; text-align: justify;"><span style="font-family: Poppins;">&nbsp;</span></p><p class="MsoNormal" style="margin: 0cm; font-size: 12pt; font-family: &quot;Times New Roman&quot;, serif; text-align: justify;"><span style="font-family: Poppins;">Beberapa adat-istiadat yang masih berlangsung dan masih lestari di Kalurahan Sentolo sebagai wujud kedaulatan politik masyarakat adalah paguyuban warga, pengangkatan juru kunci makam, pengangkatan rois/prodiakon, rembug RT/RW, pelestarian budaya gotong royong/gugur gunung/kerja bakti/sambatan, nyadran, merti dusun, kenduri, tawu sendang, tasyakuran panen, majelis taklim, kelompok penggiat seni dan budaya, perawatan cagar budaya, tilikan, babad dalan. Selain itu juga terdapat kegiatan pemanfaatan tanah Kalurahan (tanah kas Kalurahan, bengkok/lungguh, tanah pengarem-arem) dan Fasilitasi pengurusan kekancingan tanah sultan ground yang dimanfaatkan oleh masyarakat.<o:p></o:p></span></p><p class="MsoNormal" style="margin: 0cm; font-size: 12pt; font-family: &quot;Times New Roman&quot;, serif; text-align: justify;"><span style="font-family: Poppins;">&nbsp;</span></p><p class="MsoNormal" style="margin: 0cm; font-size: 12pt; font-family: &quot;Times New Roman&quot;, serif; text-align: justify;"><b><span style="font-family: Poppins;">KEADAAN EKONOMI<o:p></o:p></span></b></p><p class="MsoNormal" style="margin: 0cm; font-size: 12pt; font-family: &quot;Times New Roman&quot;, serif; text-align: justify;"><span style="font-family: Poppins;">&nbsp;</span></p><p class="MsoNormal" style="margin: 0cm; font-size: 12pt; font-family: &quot;Times New Roman&quot;, serif; text-align: justify;"><b><span style="font-family: Poppins;">1. Kondisi Umum<o:p></o:p></span></b></p><p class="MsoNormal" style="margin: 0cm; font-size: 12pt; font-family: &quot;Times New Roman&quot;, serif; text-align: justify;"><span style="font-family: Poppins;">&nbsp;</span></p><p class="MsoNormal" style="margin: 0cm; font-size: 12pt; font-family: &quot;Times New Roman&quot;, serif; text-align: justify;"><span style="font-family: Poppins;">&nbsp; Kalurahan Sentolo merupakan Kalurahan yang pertumbuhan ekonominya termasuk kategori berkembang. Hal ini dikarenakan sebagian besar penduduk Kalurahan Sentolo bekerja sebagai karyawan swasta, buruh harian lepas, petani /pekebun/buruh tani, wiraswasta, perdagangan/pedagang, sehingga untuk mengembangkan potensi ekonomi Kalurahan melalui pelatihan ekonomi produktif berupa life skill. Kalurahan Sentolo termasuk wilayah perkotaan dengan nuansa agraris. Hal ini dapat terlihat dari aktivitas/mata pencaharian dari masyarakatnya yang masih menggantungkan dari hasil pertanian. Namun demikian, hasil pertanian saat ini masih dijual dalam bentuk aslinya karena belum diolah menjadi suatu komoditi perdagangan yang dapat meningkatkan nilai jual, dengan demikian masyarakat belum dapat secara optimal mendapatkan nilai jual hasil pertanian dengan harga yang memuaskan.<o:p></o:p></span></p><p class="MsoNormal" style="margin: 0cm; font-size: 12pt; font-family: &quot;Times New Roman&quot;, serif; text-align: justify;"><span style="font-family: Poppins;">&nbsp;</span></p><p class="MsoNormal" style="margin: 0cm; font-size: 12pt; font-family: &quot;Times New Roman&quot;, serif; text-align: justify;"><span style="font-family: Poppins;">&nbsp;&nbsp;&nbsp;&nbsp; Selain itu, masyarakat Kalurahan Sentolo masih banyak yang mencari kerja diluar daerah, sehingga diperlukan pembukaan lapangan kerja di Wilayah Kalurahan Sentolo. Kerajinan dan souvenir yang masih banyak dibutuhkan sangat potensial dikembangkan untuk mendukung pembangunan Kulon Progo di masa mendatang. Dengan keadaan tersebut maka Pemerintah Kalurahan Sentolo berupaya untuk meningkatkan perekonomian warga melalui berbagai program pemerintah baik pemerintah DIY maupun pemerintah Kabupaten Kulon Progo. Dan pemerintah Kalurahan juga menjalin kerjasama dengan pihak Ketiga, instansi terkait, lembaga masyarakat sebagai mitra pemerintah Kalurahan untuk program pengentasan kemiskinan serta membuka lapangan kerja agar dapat memberikan penghasilan kepada masyarakat yang belum mempunyai pekerjaan tetap.<o:p></o:p></span></p><p class="MsoNormal" style="margin: 0cm; font-size: 12pt; font-family: &quot;Times New Roman&quot;, serif; text-align: justify;"><span style="font-family: Poppins;">&nbsp;</span></p><p class="MsoNormal" style="margin: 0cm; font-size: 12pt; font-family: &quot;Times New Roman&quot;, serif; text-align: justify;"><span style="font-family: Poppins;">&nbsp;&nbsp;&nbsp;&nbsp; Dengan adanya Dana Kalurahan dari pemerintah pusat, Dana Keistimewaan dari Pemerintah DIY, Alokasi Dana Kalurahan melalui Pemerintah Kabupaten Kulon Progo sangat bermanfaat bagi masyarakat Kalurahan Sentolo. Bantuan ini digunakan untuk pembangunan sarana prasarana yang ada di Kalurahan Sentolo. Melalui program ini di harapkan dapat lebih meningkatkan kesejahteraan masyarakat Kalurahan Sentolo.<o:p></o:p></span></p><p class="MsoNormal" style="margin: 0cm; font-size: 12pt; font-family: &quot;Times New Roman&quot;, serif; text-align: justify;"><span style="font-family: Poppins;">&nbsp;</span></p><p class="MsoNormal" style="margin: 0cm; font-size: 12pt; font-family: &quot;Times New Roman&quot;, serif; text-align: justify;"><b><span style="font-family: Poppins;">2. Lembaga Usaha Perekonomian dan Keuangan<o:p></o:p></span></b></p><p class="MsoNormal" style="margin: 0cm; font-size: 12pt; font-family: &quot;Times New Roman&quot;, serif; text-align: justify;"><span style="font-family: Poppins;">&nbsp;</span></p><p class="MsoNormal" style="margin: 0cm; font-size: 12pt; font-family: &quot;Times New Roman&quot;, serif; text-align: justify;"><span style="font-family: Poppins;">&nbsp;&nbsp;&nbsp; Terdapat berbagai Lembaga Usaha Perekonomian dan Keuangan di wilayah Kalurahan Sentolo yang terbagi dalam beberapa jenis Perbankan dan Kelompok – kelompok Usaha Perekonomian dan Keuangan, adapun jumlah Bank/Lembaga Keuangan terdapat 12 unit, mulai dari bank level nasional, daerah sampai dengan lembaga keuangan mikro. Lembaga keuangan tersebut telah mampu menggerakkan kelompok usaha ekonomi produktif dan usaha di bidang pertanian, perdagangan dan jasa.<o:p></o:p></span></p><p class="MsoNormal" style="margin: 0cm; font-size: 12pt; font-family: &quot;Times New Roman&quot;, serif; text-align: justify;"><span style="font-family: Poppins;">&nbsp;</span></p><p class="MsoNormal" style="margin: 0cm; font-size: 12pt; font-family: &quot;Times New Roman&quot;, serif; text-align: justify;"><b><span style="font-family: Poppins;">3. Teknologi Tepat Guna<o:p></o:p></span></b></p><p class="MsoNormal" style="margin: 0cm; font-size: 12pt; font-family: &quot;Times New Roman&quot;, serif; text-align: justify;"><span style="font-family: Poppins;">&nbsp;</span></p><p class="MsoNormal" style="margin: 0cm; font-size: 12pt; font-family: &quot;Times New Roman&quot;, serif; text-align: justify;"><span style="font-family: Poppins;">&nbsp;&nbsp;&nbsp; Teknologi tepat guna atau yang disingkat dengan TTG adalah teknologi yang digunakan dengan sesuai (tepat guna). Teknologi ini telah dikembangkan secara tradisional, sederhana dan proses pengenalannya banyak ditentukan oleh keadaan lingkungan dan mata pencaharian pokok masyarakat. Di Kalurahan Sentolo sendiri menggunakan Teknologi tepat guna tersebut dalam Pembuatan pupuk organik, pembuatan biogas dan lain-lain. Diharapkan dengan menggunakan teknologi tepat guna ini dapat meningkatkan hasil produksi, memudahkan pengusaha dalam memproduksi barang, memudahkan pemasaran produk dan biaya produksi yang hemat.<o:p></o:p></span></p>',
