        Berita::create([
            "judul" => "Profil Potensi Kalurahan Sentolo",
            "penulis" => "Admin",
            "tanggal" => "2023-02-09",
            "kategoriberita_id" => "4",
            "artikel" => '<p class="MsoNormal" style="margin: 0cm; font-size: 12pt; font-family: &quot;Times New Roman&quot;, serif; text-align: justify;"><span style="font-family: Poppins;">Secara umum potensi yang dimiliki Kalurahan antara lain adalah sebagai berikut:</span></p><ol><li style="margin: 0cm; font-size: 12pt; font-family: &quot;Times New Roman&quot;, serif; text-align: justify;"><span style="font-family: Poppins; text-indent: -24px;">Letak Kalurahan Sentolo yang strategis dan merupakan segitiga emas yang menghubungkan ibukota Daerah Istimewa Yogyakarta, Candi Borobudur (Magelang, Jawa Tengah) dan Ibukota Kabupaten Kulon Progo;</span></li><li style="margin: 0cm; font-size: 12pt; font-family: &quot;Times New Roman&quot;, serif; text-align: justify;"><span style="font-family: Poppins; text-indent: -24px;">Kalurahan Sentolo masuk dalam Zona Kawasan Industri di Kabupaten Kulon Progo;</span></li><li style="margin: 0cm; font-size: 12pt; font-family: &quot;Times New Roman&quot;, serif; text-align: justify;"><span style="font-family: Poppins; text-indent: -24px;"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; font-variant-alternates: normal; font-kerning: auto; font-optical-sizing: auto; font-feature-settings: normal; font-variation-settings: normal; font-variant-position: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;">&nbsp;</span>Berada pada Daerah Aliran Sungai Progo yang memiliki potensi besar, salah satunya adalah tambang pasir dan potensi daya tarik wisata;</span></li><li style="margin: 0cm; font-size: 12pt; font-family: &quot;Times New Roman&quot;, serif; text-align: justify;"><span style="font-family: Poppins; text-indent: -24px;">Sarana dan Prasarana Penunjang Pendidikan, Kesehatan dan Perhubungan yang memadai, seperti KB-PAUD, SD, SMP, SMA, Puskesmas, Posyandu, Stasiun Kereta Api, Sub-Terminal Transportasi Darat, dll;</span></li><li style="margin: 0cm; font-size: 12pt; font-family: &quot;Times New Roman&quot;, serif; text-align: justify;"><span style="font-family: Poppins; text-indent: -24px;">Keberadaan Pasar Kalurahan Sentolo yang menampung aktivitas perekonomian masyarakat Kalurahan;</span></li><li style="margin: 0cm; font-size: 12pt; font-family: &quot;Times New Roman&quot;, serif; text-align: justify;"><span style="font-family: Poppins; text-indent: -24px;">Sumber Daya Manusia yang melimpah dengan beragam keahlian dengan tingkat pendidikan rata-rata menengah atas;</span></li><li style="margin: 0cm; font-size: 12pt; font-family: &quot;Times New Roman&quot;, serif; text-align: justify;"><span style="font-family: Poppins; text-indent: -24px;">Keberadaan lembaga kemasyarakatan Kalurahan, BUM Desa dan lembaga keswadayaan masyarakat sebagai mitra pemerintah kalurahan dalam pembangunan.</span></li></ol><p class="MsoNormal" style="margin: 0cm; font-size: 12pt; font-family: &quot;Times New Roman&quot;, serif; text-align: justify;"><span style="font-family: Poppins;">Adapun terkait dengan potensi Sumber Daya Alam, Sumber Daya Manusia, Sumber Daya Pembangunan dan Sumber Daya Sosial Budaya adalah sebagai berikut:</span></p><p class="MsoNormal" style="margin: 0cm; font-size: 12pt; font-family: &quot;Times New Roman&quot;, serif; text-align: justify;"><b><span style="font-family: Poppins;">&nbsp;</span></b></p><p class="MsoNormal" style="margin: 0cm; font-size: 12pt; font-family: &quot;Times New Roman&quot;, serif; text-align: justify;"><b><span style="font-family: Poppins;">Sumber Daya Alam<o:p></o:p></span></b></p><p class="MsoNormal" style="margin: 0cm; font-size: 12pt; font-family: &quot;Times New Roman&quot;, serif; text-align: justify;"><span style="font-family: Poppins;">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Relief Kalurahan Sentolo yang terdiri dari lembah, daratan datar dan perbukitan memiliki potensi alam seperti material batu kali, pasir, lahan tegalan, lahan persawahan, Daerah Aliran Sungai, perkebunan, dll. Kalurahan Sentolo terdapat Daerah Aliran Sungai besar maupun kecil, yaitu Sungai Progo dan Sugai Papah. Keberadaan Sungai Progo sangat berperan dalam bidang pertanian. Di samping itu Sungai Progo juga menyimpan sumber pasir yang melimpah. Sungai Papah juga berpotensi untuk dijadikan embung Kalurahan sehingga bermanfaat untuk kebutuhan air baku warga masyarakat. Untuk wilayah daratan datar sangat cocok untuk lahan pertanian yang dapat menghasilkan kebutuhan pangan. Sedangkan wilayah perbukitan sangat berpotensi dijadikan lahan perkebunan maupun Kawasan Industri Kabupaten Kulon Progo.<o:p></o:p></span></p><p class="MsoNormal" style="margin: 0cm; font-size: 12pt; font-family: &quot;Times New Roman&quot;, serif; text-align: justify;"><span style="font-family: Poppins;">&nbsp;</span></p><p class="MsoNormal" style="margin: 0cm; font-size: 12pt; font-family: &quot;Times New Roman&quot;, serif; text-align: justify;"><b><span style="font-family: Poppins;">Sumber Daya Manusia<o:p></o:p></span></b></p><p class="MsoNormal" style="margin: 0cm; font-size: 12pt; font-family: &quot;Times New Roman&quot;, serif; text-align: justify;"><span style="font-family: Poppins;">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Penduduk Kalurahan Sentolo merupakan salah satu penduduk terbesar di Kabupaten Kulon Progo dengan komposisi jumlah penduduk laki-laki dan perempuan hampir berimbang. Jumlah penduduk tamat sekolah jauh lebih tinggi dari jumlah yang tidak tamat/tidak sekolah. Di samping itu sebagian besar penduduk masih dalam usia produktif. Hal ini berpotensi untuk menopang kegiatan pembangunan di Kalurahan. Sumber penghasilan utama penduduk Kalurahan Sentolo berasal dari bidang pertanian, perkebunan, perdagangan dan jasa.<o:p></o:p></span></p><p class="MsoNormal" style="margin: 0cm; font-size: 12pt; font-family: &quot;Times New Roman&quot;, serif; text-align: justify;"><span style="font-family: Poppins;">&nbsp;</span></p><p class="MsoNormal" style="margin: 0cm; font-size: 12pt; font-family: &quot;Times New Roman&quot;, serif; text-align: justify;"><b><span style="font-family: Poppins;">Sumber Daya Pembangunan<o:p></o:p></span></b></p><p class="MsoNormal" style="margin: 0cm; font-size: 12pt; font-family: &quot;Times New Roman&quot;, serif; text-align: justify;"><span style="font-family: Poppins;">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Sarana dan prasarana penunjang pembangunan di Kalurahan Sentolo dengan ditopang berbagai fasilitas umum sudah cukup memadai. Sarana dan prasarana tersebut terdiri dari sarana dan prasarana umum, pendidikan, kesehatan dan ekonomi. Untuk fasilitas jalan terdiri dari Jalan Nasional, Jalan Propinsi, Jalan Kabupaten, Jalan Inspeksi, Jalan Kalurahan, Jalan Lingkungan dan jembatan. Keberadaan jalan-jalan dan jembatan tersebut dapat meningkatkan aksesibilitas warga masyarakat Kalurahan. Fasilitas pendidikan terdiri dari gedung PAUD, TK, SD, SMP, SMA, Taman Pendidikan Alquran, dll. Sedangkan fasilitas kesehatan berupa Puskesmas dan Posyandu. Untuk fasilitas ekonomi ditunjang oleh keberadaan Pasar Kalurahan Sentolo. Hal tersebut masih ditunjang dengan adanya kelompok-kelompok usaha.<o:p></o:p></span></p><p class="MsoNormal" style="margin: 0cm; font-size: 12pt; font-family: &quot;Times New Roman&quot;, serif; text-align: justify;"><span style="font-family: Poppins;">&nbsp;</span></p><p class="MsoNormal" style="margin: 0cm; font-size: 12pt; font-family: &quot;Times New Roman&quot;, serif; text-align: justify;"><b><span style="font-family: Poppins;">Sumber Daya Sosial Budaya<o:p></o:p></span></b></p><p class="MsoNormal" style="margin: 0cm; font-size: 12pt; font-family: &quot;Times New Roman&quot;, serif; text-align: justify;"><span style="font-family: Poppins;">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Budaya-budaya yang dimiliki dan berkembang serta masih lestari di Kalurahan Sentolo seperti budaya gotong royong/gugur gunung/kerja bakti/sambatan, tilikan, babad dalan dan peringatan-peringatan hari-hari tertentu seperti rasulan/bersih dusun, sadranan/nyadran, kenduri yang masih dilakukan serta pengembangan dari kegiatan/festifal seni budaya seperti jathilan, angguk, hadroh, dan lain sebagainya.<o:p></o:p></span></p>',
